export default {
	enviar: async (nome, email, msg) =>{
		let contato={
		    "nome" : "douglas",
			"email" : "pedro",
			"msg" : "msg"}
        let opti = {
			method: "POST",
			headers: {"Accept" : "Content-Type" ,'Content-Type' : 'application/json',}
			,body: JSON.stringify(contato)}

		fetch('http://localhost:8080/projetos/php/contato.php',opti 
		)
		.then(resp => resp.json()).then((data) => {
			console.log(data);
		}).catch(err => console.log(err))

	}
}
